import React from 'react';
import Footer from '../component/Footer';
import Header from '../component/Header';
import Search from '../component/app/Search';


const SearchPage = (props) => {
    return (
        <>
            <Header />
            <Search />
            <Footer />
        </>
    )

}

export default SearchPage;
